import React, { useState, useEffect } from 'react'
import SingleResult from './SingleResult'

export default function SearchResults(props) {

    const { searchResults, setSearchResults } = props

    const [ resultGrouping, setResultGrouping ] = useState({groups: Number, currentGroup: 1})

    // Determine result grouping
    useEffect(() => {
        const numberOfGroups = Math.round(searchResults/10)
        setResultGrouping(prev => { 
            return {...prev, groups: numberOfGroups}
        })
    }, [searchResults])

    return (
        <div>
            <h3 id="searchResultsTitle">
                Showing results 1-10 of {searchResults.length}
            </h3>
            { searchResults.map( (result, index) => {
                return <SingleResult result={result} index={index}/>
            })}

        </div>
    )
}
